// SPDX-License-Identifier: MIT
pragma solidity ^0.8.6;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title UMi721
 * UMi721 - Base smart contract for UMi ERC-721 Standards
 */
contract UMi721 is ERC721, ERC721URIStorage, ERC721Burnable, Ownable {
    mapping(string => address) private _creatorsMapping;
    mapping(uint256 => string) private _tokenIdsMapping;
    mapping(string => uint256) private _tokenHashToId;
    mapping(string => address) private _redeemNftMapping;
    mapping(address => bool) private minters;
    mapping(address => bool) private proxies;
    string public contract_ipfs_json;
    bool public mintingEnabled = false;
    bool public proxyEnabled = false;
    bool public burningEnabled = false;
    bool public redeemEnabled = false;
    bool public dynamicEnabled = false;
    uint256 hardCap = 0;
    string private baseURI;
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIdCounter;
    event Minted(uint256 indexed tokenId);

    constructor(
        string memory _name,
        string memory _ticker,
        string memory _contract_ipfs,
        bool _mintingEnabled,
        bool _proxyEnabled,
        bool _burningEnabled,
        bool _redeemEnabled,
        bool _dynamicEnabled,
        string memory _base_uri,
        uint256 _hard_cap
    ) ERC721(_name, _ticker) {
        contract_ipfs_json = _contract_ipfs;
        mintingEnabled = _mintingEnabled;
        proxyEnabled = _proxyEnabled;
        burningEnabled = _burningEnabled;
        redeemEnabled = _redeemEnabled;
        dynamicEnabled = _dynamicEnabled;
        baseURI = _base_uri;
        hardCap = _hard_cap;
    }

    function _baseURI() internal view override returns (string memory) {
        return baseURI;
    }

    function tokensOfOwner(address _owner)
        external
        view
        returns (uint256[] memory ownerTokens)
    {
        uint256 tokenCount = balanceOf(_owner);
        if (tokenCount == 0) {
            // Return an empty array
            return new uint256[](0);
        } else {
            uint256[] memory result = new uint256[](tokenCount);
            uint256 totalTkns = totalSupply();
            uint256 resultIndex = 0;
            uint256 tnkId;

            for (tnkId = 1; tnkId <= totalTkns; tnkId++) {
                if (ownerOf(tnkId) == _owner) {
                    result[resultIndex] = tnkId;
                    resultIndex++;
                }
            }
            return result;
        }
    }

    function _burn(uint256 _tokenId)
        internal
        override(ERC721, ERC721URIStorage)
    {
        require(burningEnabled, "UMi721: Burning is disabled");
        super._burn(_tokenId);
    }

    function tokenURI(uint256 _tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(_tokenId);
    }

    function contractURI() public view returns (string memory) {
        return contract_ipfs_json;
    }

    function nftExists(string memory tokenHash) public view returns (bool) {
        address owner = _creatorsMapping[tokenHash];
        return owner != address(0);
    }

    function returnTokenIdByHash(string memory tokenHash)
        public
        view
        returns (uint256)
    {
        return _tokenHashToId[tokenHash];
    }

    function returnTokenURI(uint256 tokenId)
        public
        view
        returns (string memory)
    {
        return _tokenIdsMapping[tokenId];
    }

    function returnCreatorByNftHash(string memory hash)
        public
        view
        returns (address)
    {
        return _creatorsMapping[hash];
    }

    function totalSupply() public view returns (uint256) {
        return _tokenIdCounter.current();
    }

    function isProxy(address _address) public view returns (bool) {
        return proxies[_address];
    }

    function isMinter(address _address) public view returns (bool) {
        return minters[_address];
    }

    function isRedeemed(string memory _tokenURI) public view returns (bool) {
        return _redeemNftMapping[_tokenURI] != address(0);
    }

    /*
        This method will first mint the token to the owner, then will transfer the token to the user.
    */
    function dropNFT(
        address from,
        address to,
        string memory _tokenURI
    ) public {
        require(mintingEnabled, "UMi721: Minting is disabled");
        require(!nftExists(_tokenURI), "UMi721: Trying to mint existent nft");
        require(minters[msg.sender] == true, "UMi721: Only minters can mint");
        uint256 tokenId = mintTo(from, _tokenURI);
        super.transferFrom(from, to, tokenId);
    }

    /*
        This method will mint the token to provided user, can be called just by the proxy address.
    */
    function mintNFT(address _to, string memory _tokenURI) public {
        require(mintingEnabled, "UMi721: Minting is disabled");
        require(!nftExists(_tokenURI), "UMi721: Trying to mint existent nft");
        require(minters[msg.sender] == true, "UMi721: Only minters can mint");
        mintTo(_to, _tokenURI);
    }

    /*
        This method will change the metadata for provided tokenId if dynamic feature is enabled.
    */
    function fixNFT(uint256 _tokenId, string memory _tokenURI) public {
        string memory _oldURI = _tokenIdsMapping[_tokenId];
        require(dynamicEnabled, "UMi721: Dynamic is disabled");
        require(!nftExists(_tokenURI), "UMi721: Trying to mint existent nft");
        require(minters[msg.sender] == true, "UMi721: Only minters can fix metadata");
        require(_creatorsMapping[_oldURI] == msg.sender, "UMi721: Only creator can fix metadata");
        require(ownerOf(_tokenId) == msg.sender, "UMi721: Must be the owner to fix metadata");
        _setTokenURI(_tokenId, _tokenURI);
        // Creating new links
        _creatorsMapping[_tokenURI] = _creatorsMapping[_oldURI];
        _tokenIdsMapping[_tokenId] = _tokenURI;
        // Resetting previous links
        _tokenHashToId[_oldURI] = 0;
        _creatorsMapping[_oldURI] = address(0);
    }

    /*
        Private method that mints the token
    */
    function mintTo(address _to, string memory _tokenURI)
        private
        returns (uint256)
    {
        if (hardCap > 0) {
            uint256 reached = _tokenIdCounter.current() + 1;
            require(reached <= hardCap, "UMi721: Hard cap reached");
        }
        _tokenIdCounter.increment();
        uint256 newTokenId = _tokenIdCounter.current();
        _mint(_to, newTokenId);
        _setTokenURI(newTokenId, _tokenURI);
        _creatorsMapping[_tokenURI] = _to;
        _tokenIdsMapping[newTokenId] = _tokenURI;
        _tokenHashToId[_tokenURI] = newTokenId;
        emit Minted(newTokenId);
        return newTokenId;
    }

    /*
        This method will allow an NFT to be redeemed
    */
    function redeemNFT(string memory _tokenURI) public {
        require(redeemEnabled, "UMi721: Redeem not enabled");
        require(
            msg.sender == ownerOf(_tokenHashToId[_tokenURI]),
            "UMi721: You are not the owner"
        );
        require(
            _redeemNftMapping[_tokenURI] == address(0),
            "UMi721: NFT is already redeemed"
        );

        _redeemNftMapping[_tokenURI] = msg.sender;
    }

    /**
     * Admin functions
     */
    function enableProxy() public onlyOwner {
        proxyEnabled = true;
    }

    function disableProxy() public onlyOwner {
        proxyEnabled = false;
    }

    function enableRedeem() public onlyOwner {
        redeemEnabled = true;
    }

    function disableRedeem() public onlyOwner {
        redeemEnabled = false;
    }

    function enableMinting() public onlyOwner {
        mintingEnabled = true;
    }

    function disableMinting() public onlyOwner {
        mintingEnabled = false;
    }

    function enableBurning() public onlyOwner {
        burningEnabled = true;
    }

    function disableBurning() public onlyOwner {
        burningEnabled = false;
    }

    function enableDynamic() public onlyOwner {
        dynamicEnabled = true;
    }

    function disableDynamic() public onlyOwner {
        dynamicEnabled = false;
    }

    function addMinter(address _address) public onlyOwner {
        minters[_address] = true;
    }

    function removeMinter(address _address) public onlyOwner {
        minters[_address] = false;
    }

    function addProxy(address _address) public onlyOwner {
        proxies[_address] = true;
    }

    function removeProxy(address _address) public onlyOwner {
        proxies[_address] = false;
    }

    function fixContractDescription(string memory _newDescription)
        public
        onlyOwner
    {
        contract_ipfs_json = _newDescription;
    }

    function fixBaseURI(string memory _newURI) public onlyOwner {
        baseURI = _newURI;
    }

    /**
     * Override isApprovedForAll to whitelist proxy accounts
     */
    function isApprovedForAll(address _owner, address _operator)
        public
        view
        override
        returns (bool isOperator)
    {
        // Adding another burning address
        if (_owner == address(0x000000000000000000000000000000000000dEaD)) {
            return false;
        }
        // Approving for proxy addresses
        if (proxyEnabled && proxies[_operator] == true) {
            return true;
        }

        return super.isApprovedForAll(_owner, _operator);
    }
}
